const DesiredHeight = 85;
const Width = 8;
const Height = 18;
const MaxLedsInPacket = 20;
const vKeyNames = [];
const vKeyPositions = [];

for(let y = 0; y < Height; y++) {
	for(let x = 0; x < Width; x++) {
		vKeyPositions.push([y % 2 == 0 ? x : 7 - x, y]);
		vKeyNames.push("("+ x + ", " + y + ")"); 
	}
}

