export function Render() 
{
	sendColors(false);
}

export function Shutdown()
{
	sendColors(true);
}

function sendColors(shutdown = false) 
{
	const ledCount = Width * Height;
	const colorData = [];
	
	if(shutdown)
	{
		colorData = device.createColorArray(shutdownColor, ledCount, "Inline");
	}
	else if(LightingMode == "Forced")
	{
		colorData = device.createColorArray(forcedColor, ledCount, "Inline");
	}
	else
	{
        for(var ledIndex = 0; ledIndex < vKeyNames.length; ledIndex++)
        {
            const x = vKeyPositions[ledIndex][0];
            const y = vKeyPositions[ledIndex][1];
            const color = device.color(x, y);
            colorData[ledIndex*3] = color[0]; 
            colorData[ledIndex*3 + 1] = color[1];
            colorData[ledIndex*3 + 2] = color[2];
        }
	}
	
	let totalPackets = Math.ceil(ledCount / MaxLedsInPacket);
	
	for(let currentPacket = 0; currentPacket < totalPackets; currentPacket++)
	{
		let packet = [];
		packet[0] = 0x01;
		packet[1] = currentPacket;
		packet = packet.concat(colorData.splice(0,60));
		device.write(packet, 65);
	}
}

